import './App.css';


function NavHeader(){
	const [user, setUser] = useState(false);
	const googleSignIn = () => {
		setUser(true);
	};
	const signOut = () => {
		setUser(false);
	};

	return (
		<div class="text-white bg-blue-500 flex items-center justify-between">
			<h1 class="px-2 py-2 font-bold text-2xl">Nexil</h1>
			<nav>
		{user ? (
			<button onClick={signOut} className="sign-out" type="button">Sign Out</button>
		) : (
			<button className="sign-in">
			<img
			onClick={googleSignIn}
			src={GoogleSignin}
			alt="sign in with google"
			type="button"
			/>
			</button>
		)}
			</nav>
		</div>
	);
}
function Body(){
	return(
		<div class="text-white h-screen flex items-center justify-center">
			<h1 class="italic">Nothing To See Here :)</h1>
		</div>
	);
}

function App() {
  return (
    <div className="App" class="bg-gray-900">
	  <NavHeader />
	  <Body />
    </div>
  );
}

export default App;
